import React, { Component } from "react";
import api from "../../services/api";

// import { Container } from './styles';

let data = [
  {
    title: "Title",
    description: "Description",
    author: "author",
    price: "price"
  },
  {
    title: "Title1",
    description: "Description1",
    author: "author1",
    price: "price1"
  }
];

const card = () => (
  <div>
    {data.map(item => {
      return (
        <div>
          <section>
            <h2>Título</h2>
            <h3>{item.title}</h3>
          </section>
          <section>
            <h2>Descrição</h2>
            <p>{item.description}</p>
          </section>
          <section>
            <h2>Autor</h2>
            <h3>{item.author}</h3>
          </section>
          <section>
            <h2>Preço</h2>
            <h3>R${item.price}</h3>
          </section>
        </div>
      );
    })}
  </div>
);

export default class Home extends Component {
  componentDidMount() {
    this.loadAds();
  }

  loadAds = async () => {
    const response = await api.get("/ads");
    console.log(response);
  };

  render() {
    return <div>{card()}</div>;
  }
}
